webpack/basic.html.body:
webpack 基础
安装webpack
 作为全局安装 
$ npm install webpack -g
$ webpack -v
作为项目依赖安装 
$ npm install --save webpack
webpack简介（配置项有如下几点）

* entry: 入口，定义要打包的文件。（即app第一个启动文件）  

* output: 出口，定义打包输出的文件，包括路径（path），文件名（filename），还可能有运行时的访问路径（publicPath）参数。   

* module: webpack将所有的资源都看做是模块，而模块就需要加载器；主要定义一些loaders,定义哪些后缀名的文件应该用哪些loader。

* resolve: 定义能够被打包的文件，文件后缀名 

* plugins: 定义一些额外的插件
入口 (entry) 
entry: {
  home: "./home.js",
  about: "./about.js",
  contact: "./contact.js"
}
出口 (output) 
output:{
    // path目录对应一个绝对路径。
    path:__dirname+'/public',
    //静态名称：决定了每个输出 bundle 的名称
    filename:'bundle.js'
  },
加载器配置（module）
注：module 的加载顺序是从右往左的    


css 文件使用： style-loader，css-loader ，sass-loader或less-loader
js 文件使用： babel-loader，babel-preset-es2015，babel-preset-react，jsx-loader
图片文件使用：url-loader、file-loader、image-webpack-loader


解析 (resolve) 
resolve: {
        //查找module的话从这里开始查找
        root: '/Users/dongfanai/react-demo/src', //绝对路径
        //自动扩展文件后缀名，意味着我们require模块可以省略不写后缀名
        extensions: ['', '.js', '.json', '.less'],
        //模块别名定义，方便后续直接引用别名，无须多写长长的地址
        alias: {
        //后续直接 require('kr-ui') 或 import {Title} from 'kr-ui'即可
            'kr-ui' : path.join(process.cwd(), '/src/Components'),
        }
    }
插件 (plugins) 
var webpack = require('webpack')
// 导入非 webpack 默认自带插件
var ExtractTextPlugin = require('extract-text-webpack-plugin');
var DashboardPlugin = require('webpack-dashboard/plugin');

// 在配置中添加插件
plugins: [
  // 构建优化插件
  new webpack.optimize.CommonsChunkPlugin({
    name: 'vendor',
    filename: 'vendor-[hash].min.js',
  }),
  new webpack.optimize.UglifyJsPlugin({
    compress: {
      warnings: false,
      drop_console: false,
    }
  }),
  new ExtractTextPlugin({
    filename: 'build.min.css',
    allChunks: true,
  }),
  new webpack.IgnorePlugin(/^\.\/locale$/, /moment$/),
  // 编译时(compile time)插件
  new webpack.DefinePlugin({
    'process.env.NODE_ENV': '"production"',
  }),
  // webpack-dev-server 强化插件
  new DashboardPlugin(),
  new webpack.HotModuleReplacementPlugin(),
]

webpack/test.html.body:
webpack 按需打包加载
需要react按需加载的场景
使用react做项目的过程中大家可能会发现一个问题,就是首次打开使用react制作的网站时它的首次渲染速度都比较慢,特别是一些相对来说比较大型的网站.这是因为react+webpack的开发模式下默认会把你整个项目打包成一个js文件,当你在首次渲染时,它必须下载你整个项目的代码,然后才开始渲染页面,如果你的项目代码量非常多的话这样就会导致你的整个项目首次渲染速度非常的慢,此时按需(模块化)加载也就派上用场了.
怎么设置按需加载
webpack设置部分
其实就是在webpack.config.js配置文件中,开启分块打包模式(chunkFilename),在文件出口处添加chunkFilename: '[name].[chunkhash:5].chunk.js'这一项.其中[name]是指文件名(未赋值时默认是文件的id),[chunkhash:5]指提取hash值的前五位数字,要用hash值前五位数来命名的好处是在开发模式中未修改代码的页面不会重新打包,提升开发速度
 output: {
    filename: 'application.js',
    path: path.join(__dirname, './dist'),
    publicPath: "/dist/",
    chunkFilename: '[name].[chunkhash:5].chunk.js'
  },
路由设置部分
在webpack中为我们提供了require.ensure这么一个加载函数,其中它接受三个参数,第一个参数是依赖插件(较少用到),第二个参数是一个回调函数(重点,这个回调函数是我们的打包逻辑),第三个参数是分包块文件的文件名(对应webpack.config.js中 chunkFilename中[name]这个字段).利用require.ensure函数搭配react-router中的getComponent组件加载函数来使用,就能成功设置按需加载了:
1、原来的路由文件写法:
import React from 'react'
import { Route , IndexRoute } from 'react-router'
import App from './containers/App'

import Detail from './components/Detail'

import NotFound from './components/NotFound'
import Home from './components/Home'

export default (






)
2、修改为按需加载的路由文件写法:
import React from 'react'
import { Route , IndexRoute } from 'react-router'
//公共组件按正常方式渲染
import App from './containers/App'

//需要按需加载的页面getComponent方法
const Home = (location, callback) => {
  require.ensure([], require => {
    callback(null, require('./components/Home').default)
  }, 'home')
};

